import PySimpleGUI as sg
import io
from PIL import Image
import base64

sg.Window._move_all_windows = True

def resize_base64_image(image64, size):
    '''
    May not be the original purpose, but this code is being used to resize an image for use with PySimpleGUI (tkinter) button graphics
    :param image64: (str) The Base64 image
    :param size: Tuple[int, int] Size to make the image in pixels (width, height)
    :return: (str) A new Base64 image
    '''
    image_file = io.BytesIO(base64.b64decode(image64))
    img = Image.open(image_file)
    img.thumbnail(size, Image.ANTIALIAS)
    bio = io.BytesIO()
    img.save(bio, format='PNG')
    imgbytes = bio.getvalue()
    return imgbytes

scan_qr = b''
input_key =b''

background_image =b''

layout_background = [[sg.Image(data=resize_base64_image(background_image,(1500, 1000)))]]
window_background = sg.Window('Background', layout_background, no_titlebar=True, finalize=True, margins=(0, 0), element_padding=(0,0), right_click_menu=[[''], ['Exit',]])

layout_top = [[sg.Text('Select input delivery notification number option: ', font=("Helvetica", 35), pad= (5,10))],
              [sg.Text('Scan QR', font=("Helvetica", 25),),sg.Text(' ' * 95), 
              sg.Text('Manual input ', font=("Helvetica", 25))],
          [sg.Button(image_data= resize_base64_image(scan_qr,(450, 450)), border_width=3, pad =(50,5),button_color= 'white on #e5eefc',key='-QR-'),
          sg.Button(image_data= resize_base64_image(input_key,(450, 450)) ,border_width=3, pad =(50,5),button_color= 'white on #e5eefc',  key='-INKEY-')]
        ]

window_top = sg.Window('sdas', layout_top,  element_justification="center" ,keep_on_top=True, no_titlebar=True, location=(180, 185), transparent_color=sg.theme_background_color(),  finalize=True)


while True:
    window, event, values = sg.read_all_windows()
